import { LOGGEDIN_USER } from '../actions/userActions';

export default function userReducer(state = '', { type, payload }) {
    console.log("payload : ",payload);
    switch (type) {
        case LOGGEDIN_USER: return {abc:'123'};
        default:return state;
    }
}
